import "./App.css";
import BackgroundSlider from "./BackgroundSlider";
import Navbar from "./components/Navbar";

import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar />
      </BrowserRouter>
      <BackgroundSlider />
    </div>
  );
}

export default App;
